import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
    <div >
      <div style={{display: "flex"}}>
      <img src="https://radioprog.ru/uploads/media/articles/0001/01/2cc857f7f034ad92dae834fba16b89999b455fb0.png" alt="htlm" width="100px"/> 
      <h3>HTML - Frontent yo'nalishining asosiy terxnologiyasi bo'lib, unda asosan interfaysning asosi quriladi. </h3>
      </div>
      <hr />

      <div style={{display: "flex"}}>
      <img src="https://world-it.ro/images/logo_CSS.png" alt="css" width="100px"/>
      <h3>CSS - frontend yo'nalishining interfeys dizayniga javob beradigan asosiy texnologiya</h3>
      </div>

      <div style={{display: "flex"}}>
      <img src="https://mpng.subpng.com/20180411/cvq/kisspng-javascript-html-computer-software-web-browser-watermark-5acdbd54ac19f7.4484983215234327887049.jpg" alt="js" width="100px"/>
      <h3>JavaScript - frontend yo'nalishining interfeysini jonlantirish uchun mo'ljallangan dasturlash tili.</h3>
      </div>


    </div>
  ,document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
